import { useState, useEffect } from 'react';
import * as d3 from 'd3';

/**
 * Custom hook to load and parse the disaster dataset from CSV
 * @returns {Object} { data, loading, error }
 */
function useDisasterData() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Load CSV data
    d3.csv('/data/disasters.csv')
      .then((rawData) => {
        // #region agent log
        fetch('http://127.0.0.1:7242/ingest/accdc406-803f-4a93-9fb7-def01f06e7cc',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'useDisasterData.js:16',message:'CSV loaded - raw data check',data:{rowCount:rawData.length,firstRow:rawData[0],columnNames:rawData.length>0?Object.keys(rawData[0]):[]},timestamp:Date.now(),sessionId:'debug-session',hypothesisId:'B,D'})}).catch(()=>{});
        // #endregion

        // Parse and transform the data
        const parsedData = rawData.map((d, idx) => {
          // Parse date
          const dateStr = d.date;
          const parsedDate = new Date(dateStr);

          // #region agent log
          if (idx === 0) {
            fetch('http://127.0.0.1:7242/ingest/accdc406-803f-4a93-9fb7-def01f06e7cc',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'useDisasterData.js:25',message:'First row parsing check',data:{dateStr:dateStr,parsedDate:parsedDate.toString(),isValidDate:!isNaN(parsedDate.getTime()),country:d.country,countryType:typeof d.country,disaster_type:d.disaster_type,disasterTypeType:typeof d.disaster_type,rawFirstRow:d},timestamp:Date.now(),sessionId:'debug-session',hypothesisId:'A,B,E'})}).catch(()=>{});
          }
          // #endregion

          return {
            // Original fields
            date: parsedDate,
            country: d.country,
            disaster_type: d.disaster_type,

            // Numeric fields - convert to numbers
            severity_index: +d.severity_index || 0,
            casualties: +d.casualties || 0,
            economic_loss_usd: +d.economic_loss_usd || 0,
            response_time_hours: +d.response_time_hours || 0,
            aid_amount_usd: +d.aid_amount_usd || 0,
            response_efficiency_score: +d.response_efficiency_score || 0,
            recovery_days: +d.recovery_days || 0,
            latitude: +d.latitude || 0,
            longitude: +d.longitude || 0,

            // Derived fields
            year: parsedDate.getFullYear(),
            month: parsedDate.getMonth() + 1,
            yearMonth: `${parsedDate.getFullYear()}-${String(parsedDate.getMonth() + 1).padStart(2, '0')}`
          };
        });

        // #region agent log
        fetch('http://127.0.0.1:7242/ingest/accdc406-803f-4a93-9fb7-def01f06e7cc',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'useDisasterData.js:48',message:'Before filtering - parsed data check',data:{parsedCount:parsedData.length,firstThree:parsedData.slice(0,3).map(d=>({dateValid:!isNaN(d.date.getTime()),country:d.country,disaster_type:d.disaster_type}))},timestamp:Date.now(),sessionId:'debug-session',hypothesisId:'A,E'})}).catch(()=>{});
        // #endregion

        // Filter out any invalid entries
        const validData = parsedData.filter((d, idx) => {
          const isValid = !isNaN(d.date.getTime()) && d.country && d.disaster_type;
          // #region agent log
          if (idx < 3) {
            fetch('http://127.0.0.1:7242/ingest/accdc406-803f-4a93-9fb7-def01f06e7cc',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'useDisasterData.js:52',message:'Filter check for first rows',data:{idx:idx,dateCheck:!isNaN(d.date.getTime()),dateValue:d.date.getTime(),countryCheck:!!d.country,countryValue:d.country,disasterTypeCheck:!!d.disaster_type,disasterTypeValue:d.disaster_type,isValid:isValid},timestamp:Date.now(),sessionId:'debug-session',hypothesisId:'A,E'})}).catch(()=>{});
          }
          // #endregion
          return isValid;
        });

        // #region agent log
        fetch('http://127.0.0.1:7242/ingest/accdc406-803f-4a93-9fb7-def01f06e7cc',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'useDisasterData.js:58',message:'After filtering - validation results',data:{validCount:validData.length,totalParsed:parsedData.length,filterRatio:validData.length/parsedData.length},timestamp:Date.now(),sessionId:'debug-session',hypothesisId:'A,E'})}).catch(()=>{});
        // #endregion

        console.log(`Loaded ${validData.length} disaster events`);
        console.log('Sample data:', validData.slice(0, 3));
        console.log('Years range:', d3.extent(validData, d => d.year));
        console.log('Unique disaster types:', [...new Set(validData.map(d => d.disaster_type))]);
        console.log('Unique countries:', validData.map(d => d.country).filter((v, i, a) => a.indexOf(v) === i).length);

        setData(validData);
        setLoading(false);
      })
      .catch((err) => {
        console.error('Error loading disaster data:', err);
        setError(err.message);
        setLoading(false);
      });
  }, []);

  return { data, loading, error };
}

export default useDisasterData;
